import React, { Component, useState } from "react";
import { connect } from "react-redux";

const [FormData, setformData] = useState({
  nome: "",
  email: "",
  mensagem: "",
  telefone: ""
});
const { nome, email, mensagem, telefone } = FormData;

const Formulario = () => {
  return (
    <div>
      <form>
        <div className="form-group">
          <input type="text" value={nome} placeholder="Digite o seu nome" />
        </div>
        <div className="form-group">
          <input type="email" value={email} placeholder="Qual seu e-mail?" />
        </div>
        <div className="form-group">
          <input placeholder="Digite seu telefone com DDD" value={telefone} />
        </div>
        <div className="form-group">
          <textarea
            placeholder="Digite o que nos deseja enviar"
            value={mensagem}
          />
          <small id="emailHelp" class="form-text text-white">
            Iremos responder o mais rápido possível!
          </small>
        </div>
        <div className="form-group">
          <button type="submit" class="btn btn-primary">
            Enviar
          </button>
        </div>
      </form>
    </div>
  );
};

export default Formulario;
